CREATE TABLE Orszag (
    orszag_id INT PRIMARY KEY,
    nev VARCHAR(100) NOT NULL
);

CREATE TABLE Bajnoksag (
    bajnoksag_id INT PRIMARY KEY,
    bajnoksag_nev VARCHAR(100),
    orszag INT,
    FOREIGN KEY (orszag) REFERENCES Orszag (orszag_id)
);

CREATE TABLE Csapat (
    csapat_id INT PRIMARY KEY,
    nev VARCHAR(100) NOT NULL,
    bajnoksag_id INT,
    FOREIGN KEY (bajnoksag_id) REFERENCES Bajnoksag (bajnoksag_id)
);

CREATE TABLE Jatekos (
    player_id INT PRIMARY KEY,
    nev VARCHAR(100) NOT NULL,
    szuletett DATE,
    csapat_id INT,
    FOREIGN KEY (csapat_id) REFERENCES Csapat (csapat_id)
);

CREATE TABLE Meccsek (
    meccs_id INT PRIMARY KEY,
    hazai_csapat_id INT,
    vendeg_csapat_id INT,
    hazai_golok INT,
    vendeg_golok INT,
    FOREIGN KEY (hazai_csapat_id) REFERENCES Csapat (csapat_id),
    FOREIGN KEY (vendeg_csapat_id) REFERENCES Csapat (csapat_id)
);






